// USER ACTIONS

export {
  GET_CURRENT_USER_START,
  GET_CURRENT_USER_SUCCESS,
  GET_CURRENT_USER_FAILED,
  getCurrentUser,
} from "./getCurrentUser";

export {
  GET_USERS_START,
  GET_USERS_SUCCESS,
  GET_USERS_FAILURE,
  getUsers,
} from "./getUsers";

// TASK ACTIONS

export {
  CALENDAR_VIEW,
  LIST_VIEW,
  toggleCalendarView,
  toggleListView,
} from "./taskToggle";

// WORK ORDER ACTIONS

export {
  OPEN_WORK_ORDERS,
  CLOSE_WORK_ORDERS,
  openWorkOrders,
  closeWorkOrders,
} from "./workOrderToggle";

export {
  ADD_WORK_ORDER_START,
  ADD_WORK_ORDER_SUCCESS,
  ADD_WORK_ORDER_FAILURE,
  addWorkOrder,
} from "./addWorkOrder";

const dbUrl =
  "http://localhost:5000/rocky-mountain-lifts-crm-db/us-central1/api"; // Development URL
// const dbUrl = 'https://us-central1-rocky-mountain-lifts-crm-db.cloudfunctions.net/api'; // Production URL

export { dbUrl };
